MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "The CalibreMDPview data viewer is a full-featured application providing quick and easy review of fractured data and the layout data used to generate it. ");
MGCAddSnippet(5, "The Calibre MDPview layout viewer is part of a family of Calibre layout viewers that are used to view and manipulate layouts. With it, you can do the following:");
MGCAddSnippet(6, "Calibre MDPview is part of a suite of tools for the Calibre Mask Data Preparation (MDP) flow. Calibre MDP allows for seamless continuation of the data manipulations required for Resolution Enhancement Technology (RET) techniques to the mask data format conversion in one batch run, keeping data hierarchically represented as long as possible.");
MGCAddSnippet(7, "There are a number of prerequisites before using Calibre MDPview.");
MGCAddSnippet(8, "You run the Calibre MDPview data viewer from a command line shell using command line invocations.");
MGCAddSnippet(9, "You invoke Calibre MDPview from a command console. The actual command you use controls which of the tools you invoke. The command arguments control the mode of operation. Use the following steps to invoke Calibre MDPview.");
MGCAddSnippet(10, "Used alone, the invocation command calibremdpv invokes the Calibre MDPview layout viewer. Optional command switches let you open the application in different modes, evaluate scripts, or load data upon invocation. ");
MGCAddSnippet(11, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(12, "There are a number Calibre MDPview-specific operations related to viewing mask data in either database format (typically GDS or OASIS) or fractured format. Once displayed, you can analyze the data.");
MGCAddSnippet(13, "Calibre MDPview supports the following fracture pattern files shown in the following table.");
MGCAddSnippet(14, "Data displayed in Calibre MDPview is comprised of layers. For fractured data, each layer represents a unique mask level. For database data, it may take several layers to make up a mask level.");
MGCAddSnippet(15, "The layout hierarchy defines the structure of the layout data: the building blocks and instances of these building blocks. ");
MGCAddSnippet(16, "In some cases the window size needed to view all of your data can be very large in relation to the size of the geometries. When this occurs, your geometries may not display properly. To ensure that you see the geometries correctly you can change the size of the smallest object that is displayed.");
MGCAddSnippet(17, "When the current cell (the data that you can see in the Calibre MDPview data viewer) is hierarchical, you can view more than one hierarchical level at a time.");
MGCAddSnippet(18, "At the top level of the job deck view depth, you can show the relative orientation of all cells to the viewer window (indicated by an triangle with an  F ). This allows you to see how the top cell is oriented after transformation (such as with a rotation or mirror) when interactive commands are given, without having to re-render the entire cell. ");
MGCAddSnippet(19, "For fracture formats like MEBES that represent fractured data using a proprietary organizational structure, you can control which groups of the pattern data you see by setting the MDP mode. ");
MGCAddSnippet(20, "You can perform visual cell pruning (hiding certain cells from display in order to speed up redraw times) using two different methods.");
MGCAddSnippet(21, "If you select View > MDP Chip View, you can display chip file names displayed as colored layers in the Layer Palette.");
MGCAddSnippet(22, "You can mark the layout origin point (0,0) by toggling the Marker at Origin setting (found in the Options > Layout View dialog box). ");
MGCAddSnippet(23, "When drawing crosses on MDP geometry objects, Calibre MDPview allows you can add, track, and remove selected layers from a set of layers for cross-drawing.");
MGCAddSnippet(24, "If you have a shared reticle (where several different chips are in the same reticle), if patterns are missing, it may be difficult to find out the specific patterns. You can search for these missing patterns using the View > MDP Mode > Missing Chip Markers. This option draws markers for any missing chip definition files.");
MGCAddSnippet(25, "Loading pattern file or database data causes that data to be displayed, making it the current layoutIn the Calibre MDPview data viewer, each data file, pattern file, or database, is referred to as a layout.. Any previously loaded layouts remain available, though they are not visible, and therefore not current. ");
MGCAddSnippet(26, "The Calibre MDPview data viewer supports loading and viewing pattern files in the following industry-standard fracture formats: MEBES, Hitachi, JEOL, Micronic, Nuflare, and OASIS.");
MGCAddSnippet(27, "OASIS files in extended MEBES job decks can be  pre-indexed  to speed job deck loading. Typically, you would use the -v option when invoking Calibre MDPview to load an OASIS layout file as a view-only, disk-resident, indexed file ");
MGCAddSnippet(28, "Once loaded into the Calibre MDPview application, job deck data behaves as if it were a single file. As with viewing a single pattern file, you typically see the design as white bounding boxes; however, in Job View the lines show the individual pattern files that were loaded in.");
MGCAddSnippet(29, "When viewing VSB job decks (Nuflare formats VSB11, VSB12, VSB12i, and NUFLARE_MBF), you must use an absolute path for accessing pattern files in other locations for the job view. By default, a VSB job deck is represented by one directory. Under this directory are the job deck script files layout.ini, chip.ini, layout directory, and the chip directories. The draw script files are under layout directory.");
MGCAddSnippet(30, "The MEBES flexible job deck is a job deck written using the MEBES commands that can reference pattern files in MEBES, JEOL, Hitachi, or VSB format, as well as GDSII and OASIS formatted data. Flexible job deck functionality allows you to create a MEBES type job deck that describes a mask composed of a mixture of any of these pattern files. ");
MGCAddSnippet(31, "Calibre MDPview allows you to load extended job decks, which are MEBES job decks that reference MEBES data and GDSII or OASIS formatted data. ");
MGCAddSnippet(32, "Normally, loading a job deck through either File > MEBES > Job View, File > View Mask Job Deck > VSB, or File > JEOL > Job View requires the pattern files referenced in a job deck to exist in the directory containing the job deck file.");
MGCAddSnippet(33, "Calibre MDPview follows a specific process and rules for a loaded MEBES job deck in order to recognize corresponding pattern file names.");
MGCAddSnippet(34, "The Calibre FRACTURE operation converts layer data into MEBES, JEOL, Hitachi, Micronic, Nuflare, and OASIS formatted data. ");
MGCAddSnippet(35, "With the MDP Fracture GUI, you can a number of FRACTURE-related tasks.");
MGCAddSnippet(36, "Both Fracture and Verification can be performed through the MDP Fracture GUI.");
MGCAddSnippet(37, "You can compare verify regions on two fracture files in the MDP Fracture GUI.");
MGCAddSnippet(38, "The Basic Settings tab allows you to define the original and derived layers with the output parameters as well as required user inputs. ");
MGCAddSnippet(39, "The Fracture tab allows you to define a Calibre FRACTURE operation to convert a GDS or OASIS database to a particular fracture format such as MEBES, JEOL, Hitachi, Micronic, Nuflare, or OASIS (listed as  VBOASIS ). This tab is available when Options > Run Mode is set to either Fracture and Verify or Fracture only. ");
MGCAddSnippet(40, "The Verify tab allows you to define settings for Calibre MDPverify to perform comparisons between an original database to a pattern file, or between two pattern files. This tab is available when Options > Run Mode is set to either Fracture and Verify or Verify only. ");
MGCAddSnippet(41, "If you have completed filling in the information for Basic Settings, Fracture and/or Verify, click the View SVRF button to see the SVRF code in a text viewer. Clicking View SVRF creates an SVRF file with the same name as the layout s name appended with .svrf. The file is saved in the working directory. The file is saved by default, in the directory from which Calibre MDPview was invoked (unless otherwise specified).");
MGCAddSnippet(42, "The menu bar contains several operations for FRACTURE and MDPverify runs.");
MGCAddSnippet(43, "The scripting capabilities provided by the Calibre MDPview data viewer allow you to write an external script that manipulates one or more layouts databases. You write these scripts using the Tcl programming language, referencing the Viewer layout object. ");
MGCAddSnippet(44, "Layout assembly takes existing cells or layout files and combines them. Assembly is used in a variety of situations, such as combining multiple layouts into a single hierarchical database, similar to a MEBES job deck.");
MGCAddSnippet(45, "Because pattern files are typically quite large, the Calibre MDPview data viewer does not load the data into memory when it displays it for viewing. Instead, it leaves the data on disk, sampling it as necessary to change views. Database data, on the other hand, is loaded directly into memory. As a result, pattern file data is not editable or selectable, in the ways that database data is.");
MGCAddSnippet(46, "There are several different methods supported by Calibre MDPview to inspect pattern file data.");
MGCAddSnippet(47, "A typical method of inspecting the results of a Calibre FRACTURE or Calibre MDPverify operation is to visually compare the output results with the original layout, using one of the following methods:");
MGCAddSnippet(48, "The primary method of visually comparing results is through the Overlay tool. Use this tool to overlay a pattern file over an original database or overlay Calibre MDPverify results on top of a pattern file.");
MGCAddSnippet(49, "To compare fractured data to the original layout database, you must compensate for any transformation that occurred during fracturing so the two align properly.");
MGCAddSnippet(50, "The fracture log file only records the transformation applied by the fracture operation. If you have transformed the mask layer data before using it as input to the Calibre FRACTURE command, you must make further adjustments. ");
MGCAddSnippet(51, "Assume layouts A and B where dbuA = 2 nm and dbuB = 1.25 nm. To find a DBU usable in the transform operation, find the least common multiplier of the dbus, as follows:");
MGCAddSnippet(52, "If the two layouts area magnified, mirrored, and rotated properly, but still not aligned right, you can use the Move function to reposition the data. The challenge here is that to select a  cell  in a merged layoutThe original layout is represented as a cell in the new layout., you must have only the cell outline visible, but to align it properly, you must see the contents. You can get around this by changing the view depth after putting the cursor in Move mode and selecting the cell.");
MGCAddSnippet(53, "A set of Calibre MDPview batch commands that provide a summary reports such as pattern file statistics and index file information.");
MGCAddSnippet(54, "A set of Calibre MDPview batch commands that allows you to adjust the MEBES header in a report.");
MGCAddSnippet(55, "A set of Calibre MDPview batch commands that generates a report of figure counts and shot counts.");
MGCAddSnippet(56, "Calibre MDPview provides utilities that allow you to convert data from one format to another. Conversion may be needed due to a number of possibilities. For example:");
MGCAddSnippet(57, "A set of Calibre MDPview batch commands that convert a fractured file into OASIS format.");
MGCAddSnippet(58, "A set of Calibre MDPview batch commands that optimize the hierarchy of external tool-generated GDSII or OASIS files.");
MGCAddSnippet(59, "A Calibre MDPview batch command that checks the validity of OASIS.MASK layouts");
MGCAddSnippet(60, "A Calibre MDPview batch command that converts one or more levels of a job deck into OASIS layers for input to a single Calibre hierarchical database. The OASIS file is output in STRICT mode format.");
MGCAddSnippet(61, "There are two mixed-format job decks supported by Calibre: MEBES_FLEX and the extended MEBES job decks. ");
MGCAddSnippet(62, "By default, a common database precision is computed for the resulting OASIS file. This number is the count of OASIS units per micron. The default value is computed as:");
MGCAddSnippet(63, "A Calibre MDPview command that converts a MEBES job deck to a VSB job deck. This process only changes the ASCII formatting, not the actual data.");
MGCAddSnippet(64, "A Calibre MDPview command that converts a MEBES job deck to a Micronic job deck. This process only changes the ASCII formatting, not the actual data.");
MGCAddSnippet(65, "A Calibre MDPview command that converts a JEOL job deck to a MEBES job deck. This process only changes the ASCII formatting, not the actual data.");
MGCAddSnippet(66, "A Calibre MDPview command that converts a JEOL job deck to a VSB job deck. This process only changes the ASCII formatting, not the actual data.");
MGCAddSnippet(67, "A Calibre MDPview command that converts a VSB job deck to a MEBES job deck. This command only changes the ASCII formatting, not the actual data.");
MGCAddSnippet(68, "A Calibre WORKbench batch command that creates a 2D barcode (QR code Model 2, version 4) and converts it to OASIS data.");
MGCAddSnippet(69, "Certain databases (OASIS) and pattern files (Micronic and MEBES) can be  pre-indexed  to speed job deck loading and viewing in Calibre MDPview. Refer to the following sections for descriptions on how to pre-index your files.");
MGCAddSnippet(70, "A Calibre WORKbench batch command that pre-indexes an OASIS file to speed job deck loading and pattern file viewing.");
MGCAddSnippet(71, "A Calibre WORKbench batch command that pre-indexes a Micronic file in order to speed loading and viewing.");
MGCAddSnippet(72, "A Calibre WORKbench batch command that pre-indexes a MEBES file to speed job deck loading and pattern file viewing.");
MGCAddSnippet(73, "A Calibre WORKbench batch command that pre-indexes a JEOL file in order to speed loading and viewing.");
MGCAddSnippet(74, "A Calibre WORKbench batch command that pre-indexes a VSB11 or VSB12 file in order to speed loading and viewing.");
MGCAddSnippet(75, "When you load a MEBES job deck, the application parses the job deck file, looking for commands it recognizes. Should it encounter a string or command it does not recognize, it responds by writing a warning message to the log file. Note that this does not imply that there is a problem with the file. ");
MGCAddSnippet(76, "The following table lists the possible warning messages that can be issued by Calibre MDPview.");
MGCAddSnippet(77, "The wbinit.tcl file is an application extension file that contains Tcl-based macro scripts to modify the behavior of the Calibre MDPview and Calibre WORKbench layout viewers. ");
MGCAddSnippet(78, "Typically with extended job decks, when you designate the coordinates of the input data, the data cannot extend beyond the described window (clipping data beyond window boundaries). However, if you want to display a file with data larger than the described extent in the job deck, you can use the wbinit.tcl file to allow the display of data larger than the designated window.");
MGCAddSnippet(79, "You can specify a pattern file with an unrestricted Linux style name using the EJOBDECK_EXPANDED_NAMESPACE variable. This allows you to have unrestricted file names for OASIS files. This option cannot be simultaneously specified with EJOBDECK_PATTERN_SUFFIX.");
MGCAddSnippet(80, "Typically an error message is printed to standard output if a job deck defines a nonexistent pattern file, but ignores all references to the file later. This behavior can only be changed for MEBES job decks.");
MGCAddSnippet(81, "You can control the behavior of Calibre when it encounters chips that are off the reticle (inside substrate at placement).");
MGCAddSnippet(82, "OASIS pattern files with a .oas extension can be read in MEBES extended job decks if you add the following line to the wbinit.tcl file (either locally or in your user directory):");
MGCAddSnippet(83, "Some layouts may have very large cells with a lot of data which may degrade viewing performance. To improve the efficiency of viewing (including disk-resident OASIS viewing), you can use a feature known as  VBOASIS injection.  Though this injection takes additional run time, subsequent viewings can be faster. VBOASIS (Vector-Based OASIS) is a restricted form of OASIS DDE (Direct Data Entry) files.");
MGCAddSnippet(84, "OASIS files in extended MEBES job decks can be  pre-indexed  to speed job deck loading. A separate index file named  orig_file.fvi  is created and must be kept in the same directory as the OASIS file. However, the search location of the bin injected files and .fvi files can be changed by specifying the environment variable MDPIndexSearchPath. The path for a data search is also defined using the environment variable MDPDataSearchPath.");
MGCAddSnippet(85, "You can overwrite the JOBLIB path name specified in a Micronic job deck using the MDP_MICRONIC_JOBLIB_WD environment variable.");
MGCAddSnippet(86, "You can control the index generation for pattern file viewing for MEBES and VBOASIS using a number of methods.");
MGCAddSnippet(87, "When a MEBES pattern file is loaded, Calibre MDPview automatically checks if an index file exists.");
MGCAddSnippet(88, "You can control the size (in mm) of MALY job deck SERIAL and DATE text strings using a series of wbinit.tcl variables.");
MGCAddSnippet(89, "You can control the behavior of error handling when the extent of any chip placement goes outside the chip substrate. ");
MGCAddSnippet(90, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

